package sz.zp.cks.model;

public class PerscentCounts {
	private String cksNum;
	private String repNum;
	private String matNum;
	public String getCksNum() {
		return cksNum;
	}
	public void setCksNum(String cksNum) {
		this.cksNum = cksNum;
	}
	public String getRepNum() {
		return repNum;
	}
	public void setRepNum(String repNum) {
		this.repNum = repNum;
	}
	public String getMatNum() {
		return matNum;
	}
	public void setMatNum(String matNum) {
		this.matNum = matNum;
	}
	public PerscentCounts() {
		super();
		// TODO Auto-generated constructor stub
	}
	public PerscentCounts(String cksNum, String repNum, String matNum) {
		super();
		this.cksNum = cksNum;
		this.repNum = repNum;
		this.matNum = matNum;
	}
	
	
	
	
}
